import './estilos_campo_central.css';
import Registro_Empresa from '../Registro_Empresa/registro_empresa';
import React from 'react';

class Campo_Central extends React.Component{
  constructor(props){
    super(props);
    this.state={
      estado:props.estado
    };
  }

  render(){
    return
  }
}

export default Campo_Central;
